def get_faves():
    # read the faves data file
    faves = Path('faves.json')
    if not faves.exists():
        raise FileNotFoundError
    else:
        with open(faves) as f:
            d = json.load(f)
    return d

def save_faves(new_entry):
    faves = Path('faves.json')
    try:
        d = get_faves()
    except FileNotFoundError:
        d = {}
    d.update(new_entry)
    with open(faves, 'w') as f:
        json.dump(d, f)

